import React from'react';
import AddIcon from '@mui/icons-material/Add';
const ToDoLists = (props) => {

    
    return (
        <>
        <div className="todo_style">
        <AddIcon />
                onClick = {()=>{
            props.onSelect(props.id)
        }}
        
        />
        <li>{props.text}</li>

        </div>
        </>
    );
};
export default ToDoLists;
